JFK: The Smoking Gun

History Documentary hosted by Alex Ivanovici, published by Discovery Channel in 2013 - English narration


Information
------------------------------

One of Australia's most celebrated homicide detectives, Colin McLaren, uncovers the shocking truth about who really killed US President John F. Kennedy in JFK: The Smoking Gun
JFK: The Smoking Gun sees McLaren using ballistics, forensic evidence, eyewitness accounts and buried testimonies to prove that the fatal gunshot came from a Secret Service agent riding in the car behind the president.
McLaren also reveals the Secret Service cover-up that followed JFK's assassination, using exhibits and interviews that have been previously hidden.

